INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (0, 1, 1052501, "", 11, 0, 6, "素敵なケーキをありがとう！\nまさかこんな盛大に\nお祝いしてもらえるなんて\n思わなかったわ！", 105211, 1052501040, 1);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES ("", "", 1052501, "", 91, "", "", "", 0, 1052501041, "");
