INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (0, 1, 1052501, "", 11, 0, 6, "おめでとうって言ってもらえるだけでも\nうれしいのに、手作りのケーキまで……\n私、あなたにいろんなものを\nもらってばっかりね。", 105211, 1052501043, 1);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES ("", "", 1052501, "", 91, "", "", "", 0, 1052501044, "");
